import React, { useState } from "react";
import { Card, CardContent } from "@/components/ui/card";
import { Input } from "@/components/ui/input";
import { Button } from "@/components/ui/button";
import { Table, TableHead, TableRow, TableCell, TableBody } from "@/components/ui/table";

const PlaceManagement = () => {
  const [places, setPlaces] = useState([]);
  const [search, setSearch] = useState("");
  const [formData, setFormData] = useState({
    date: "",
    description: "",
    image: "",
    place: "",
  });
  const [editingIndex, setEditingIndex] = useState(null);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleAddOrUpdate = () => {
    if (editingIndex !== null) {
      const updatedPlaces = [...places];
      updatedPlaces[editingIndex] = formData;
      setPlaces(updatedPlaces);
    } else {
      setPlaces([...places, formData]);
    }
    setFormData({ date: "", description: "", image: "", place: "" });
    setEditingIndex(null);
  };

  const handleEdit = (index) => {
    setFormData(places[index]);
    setEditingIndex(index);
  };

  const handleDelete = (index) => {
    setPlaces(places.filter((_, i) => i !== index));
  };

  const filteredPlaces = places.filter(
    (place) =>
      place.date.includes(search) ||
      place.description.toLowerCase().includes(search.toLowerCase()) ||
      place.place.toLowerCase().includes(search.toLowerCase())
  );

  return (
    <div className="p-6 space-y-4">
      <h1 className="text-2xl font-bold">Place Management</h1>

      <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
        <Input
          type="text"
          placeholder="Search by Date, Description, or Place"
          value={search}
          onChange={(e) => setSearch(e.target.value)}
          className="col-span-2"
        />

        <Input
          type="date"
          name="date"
          value={formData.date}
          onChange={handleInputChange}
          placeholder="Date"
        />
        <Input
          type="text"
          name="description"
          value={formData.description}
          onChange={handleInputChange}
          placeholder="Description"
        />
        <Input
          type="text"
          name="image"
          value={formData.image}
          onChange={handleInputChange}
          placeholder="Image URL"
        />
        <Input
          type="text"
          name="place"
          value={formData.place}
          onChange={handleInputChange}
          placeholder="Place"
        />
        <Button onClick={handleAddOrUpdate} className="w-full md:col-span-2">
          {editingIndex !== null ? "Update" : "Add"} Place
        </Button>
      </div>

      <Card className="mt-4">
        <CardContent>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Date</TableCell>
                <TableCell>Description</TableCell>
                <TableCell>Image</TableCell>
                <TableCell>Place</TableCell>
                <TableCell>Actions</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {filteredPlaces.map((place, index) => (
                <TableRow key={index}>
                  <TableCell>{place.date}</TableCell>
                  <TableCell>{place.description}</TableCell>
                  <TableCell>
                    <img
                      src={place.image}
                      alt={place.description}
                      className="w-16 h-16 object-cover rounded-md"
                    />
                  </TableCell>
                  <TableCell>{place.place}</TableCell>
                  <TableCell>
                    <div className="flex space-x-2">
                      <Button variant="outline" onClick={() => handleEdit(index)}>
                        Edit
                      </Button>
                      <Button variant="destructive" onClick={() => handleDelete(index)}>
                        Delete
                      </Button>
                    </div>
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </CardContent>
      </Card>
    </div>
  );
};

export default PlaceManagement;
